    false,nt"url": null,nt"notes": "Conductivity Temperature and Depth (CTD)
    measurements were collected aboard the R/V Seward Johnson, Cruise 1, Leg 3, to determine
    physical oceanographic parameters of the water column, and in some cases used to
    help guide sample collection as part of the Deepwater Horizon oil spill sampling
    effort. Temperature, conductivity/salinity, depth, dissolved oxygen, and fluorometry
    data were collected onboard the Seward Johnson, Cruise 1, Leg 3. The final product
    is a series of NetCDF files containing every CTD cast that has been processed and
    quality checked.",nt"owner_org": "9cda5205-d632-4814-96e7-a4ab5e0dce85",nt"extras":
